import React, { useState } from "react";
import { FiUser } from "react-icons/fi";
import { TfiAlignCenter } from "react-icons/tfi";
import "../Navbar/Navbar.css";
import { Link } from "react-router-dom";

const Navbar = () => {
  const [openHamburger,setopenHamburger] = useState(false);

  const handleShowbar = () => {
    setopenHamburger(!openHamburger);
  };

  return (
    <>
      <header>
        <div className='Navbars'>
          <div className="logo"> <a href='#'>AllForYouGift</a></div>
          <ul className='links'>
            <li><a href ="/">home</a></li>
            <li><a href='#listProduct'>Product</a></li>
            <li><a href='#Maplocation'>location</a></li>
            <li><a href='#From'>Contact</a></li>
            <li><Link to ="reminder"></Link><span className="Reminder">Create Reminder birtdays people</span></li>
          </ul>
          <div className='action_button'>
            {/* <a href='users' >Buat akun<FiUser /></a> */}
          </div>
          <div className="toggle_btn" onClick={handleShowbar} >     
            <TfiAlignCenter   />
          </div>
        </div>
        <div>

        </div>
        <div className={`dropdown_menu ${openHamburger && "active"}` }>
          <li><a href='/'>Home</a></li>
          <li><a href='#listProduct'>Product</a></li>
          <li><a href='#Maplocation'>location</a></li>
          <li><a href='#From'>Contact</a></li>
          <li><a href='#Reminder'><span className="Reminder">Create Reminder birtdays people</span></a></li>

          <li><a href='users' className='action_button' >users <FiUser /></a></li>
        </div>

      </header>

    </>
  );
};

export default Navbar;
